description:
«Госуслуги Дом» — многофункциональное бесплатное приложение для решения жилищно-коммунальных вопросов. Сервис создан на основе информации, которую организации ЖКХ вносят в Государственную информационную систему жилищно-коммунального хозяйства (ГИС ЖКХ). Авторизуйтесь через подтверждённую учётную запись Госуслуг, и ваша недвижимость подгрузится автоматически.

С помощью приложения пользователи могут:
— передавать показания всех счётчиков разных коммунальных ресурсов; 
— оплачивать все счета за жилищно-коммунальные услуги; 
— подавать заявки в управляющую организацию и получать официальные ответы;
— отвечать на звонки в домофон и контролировать доступ в подъезд;
— голосовать на общих собраниях собственников;
— общаться с подтверждёнными собственниками квартир в официальных домовых чатах;
— изучать ежегодную отчётность управляющей организации;
— сообщать об авариях в аварийно-диспетчерскую службу; 
— просматривать камеры видеонаблюдения и управлять шлагбаумом или воротами;
— заказывать поверку счётчиков воды в аккредитованной лаборатории;
— изучать планы капремонта;
— оформлять страховку для защиты квартиры.

Спасибо, что пишете отзывы! Мы внимательно их читаем и постоянно совершенствуем приложение благодаря вашей обратной связи.

Ваш дом в одном приложении!
Отправлять заявки, оплачивать счета, принимать участие в опросах и общих собраниях, получать важные уведомления — теперь удобней.

Решать бытовые вопросы:
 - Вызывать мастера, следить за статусом заявки, общаться в чате и оценивать качество работы;
 - Отправлять или просматривать показания приборов учета;
 - Управлять разовыми и постоянными пропусками;
 - Заказывать товары и услуги: воду, цветы, ремонт окон и др.

Управлять счетами:
 - Получать напоминания об оплате;
 - Просматривать детализированную квитанцию и историю платежей;
 - Оплачивать все услуги одной кнопкой;
 - Подключать автоплатежи.

Взаимодействовать с соседями:
 - Размещать объявления;
 - Участвовать в общих собраниях собственников.
